  false,\n\t\"url\": null,\n\t\"notes\": \"During the 1930's, a series of navigation
  locks and dams were built on the Illinois River for bargetraffic. Lands administered
  as a part of the Illinois River National Wildlife and Fish Refuges are located in
  the Alton Pool (Meredosia Refuge), La Grange Pool (Chautauqua Refuge), and Peoria
  Pool (Cameron/Billsbach Unit) on the Illinois River. This plan describes the management
  strategies associated with these structures on the Refuge and pilot refuges.\",\n\t\"license_title\":
